import React from 'react';
import {Typography, Card, CardContent, CardMedia ,} from '@mui/material'
import cardImg from './1.png';
import AccessTimeIcon from '@mui/icons-material/AccessTime'; 
import {makeStyles} from '@material-ui/core/styles'
function Cards(props) {
    const useStyles = makeStyles(theme => ({
        wrapIcon: {
          verticalAlign: 'middle',
          display: 'inline-flex'
         }
      }));

      <Typography variant="subtitle1" >

      </Typography>
    return (
        <div>
            <Card  sx={{ maxWidth: 284 }}>
     <CardMedia 
      component="img"
      height="292"
      image={cardImg} />
     <CardContent>
       <Typography style={{
        fontFamily:'Cera Pro',
        fontSize: '18px',
        fontStyle: 'normal',
        fontWeight: '700',
        lineHeight: '23px',
        letterSpacing: '0em',
        textAlign: 'left'}} variant="subtitle1">Bring Your Human to Work</Typography>
        <Typography  style={{
            fontFamily:'Cera Pro',
            fontSize: '16px',
            fontStyle: 'normal',
            fontWeight: '400',
            lineHeight: '20px',
            letterSpacing: '0em',
            textAlign: 'left'}} variant="body1">
        Erica Keswin
        </Typography>
        <Typography variant="caption" style={{
          fontFamily:'Cera Pro',
          fontSize: '14px',
          fontStyle: 'normal',
          fontWeight: '400',
          lineHeight: '18px',
          letterSpacing: '0em',
          textAlign: 'left'
        }} className={classes.wrapIcon}>

        <LinkIcon className={classes.linkIcon}  /> revolve
        </Typography>
     </CardContent>
    </Card>
        </div>
    );
}

export default Cards;
//  <AccessTimeIcon/>    13-minute read
